import React, { Component } from 'react';
import User from './components/User';
import Navbar from './components/Navbar'
import './App.css';

class App extends Component {
  render () {
    return (
      <div className="App">
        <Navbar title = "Merhaba Props"/>
        <User 
         name = "Malik"
         department = "IT"
         skill = "React" 
        />
    </div>
    );
  }
}
export default App;
